// import logo from './logo.svg';
import "./App.css";

//import bootstrap
import "bootstrap/dist/css/bootstrap.min.css";

//import components
import AppHeader from "./components/AppHeader";
import Footer from "./components/Footer";
import { Helmet } from "react-helmet";
// import { Button } from 'react-bootstrap'
import { createTheme, MuiThemeProvider, responsiveFontSizes, ThemeProvider, Typography } from '@material-ui/core'

let theme = createTheme()

theme = responsiveFontSizes(theme)

function App() {
  return (
    <div className="App">
    <MuiThemeProvider theme={theme}>
    <AppHeader />
      <div className="CoverImg addFont">
        <Typography variant= 'h3'>Welcome to</Typography>
        <Typography variant= 'h1'>"Gendary!"</Typography>
      </div>

      <div
        className="addFont"
        style={{
          textAlign: "center",
          background: "yellow",
          textJustify: "center",
          alignItems: "center",
        }}
      >
        <p>
          This site is under redeveloped by react! {"\n"} Some Feature or page
          might not working
        </p>
      </div>
      <Footer />
    </MuiThemeProvider>
    </div>
  );
}

export default App;
